window.bookSummaryJSON = "<p>\"Oh devs who art in the issue queue. Hallowed be thy code. Thy commits merge without conflict. Thy will be done in production as it is on local. I'm sure you guys are busy and all, but I can't log out.\"</p> <p>As a programmer, Ike knows all about Virtual Dive Experiences (VDX), but when he suddenly wakes up in a virtual game he's never heard of, he’s too busy struggling to survive to worry about how he got there. Luckily, he's got a trick up his sleeve: the ability to program custom enchantments for his gear.&nbsp;</p> <p>He’ll need that and more to figure out what’s going on, since there’s no tutorial and <i>True Calling </i>plays by its own rules: Your class and race are chosen for you, the NPCs are indistinguishable from the players, every quest is unique, and the GMs keep leaving Ike’s prayers unanswered.</p>"; 
